import React from 'react';
import './App.css';
import Nav from './components/navBar/navbar.js';
import Shop from './components/Shop/shop.js';
import {Router,Route,Routes} from 'react-router-dom'

function app() {

    return (
    <div>
      <Nav />

          <Routes>

            <Route path="/" element={Shop}/>
          </Routes>

    </div>  

    );
}


export default app;
